import React from 'react';
import {Links} from 'react-router-dom';


function Nav() {
    const navStyle = {
        color: 'white'
    };
  return (
    <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
            <Link style={navStyle} to="/">
                <li>Home</li>
            </Link>

            <Link style={navStyle} to="/about">
                <li>About</li>
            </Link>

            <Link style={navStyle} to="/blog">
                <li>Blog</li>
            </Link>


            <Link style={navStyle} to="/contact">
                <li>Contact</li>
            </Link>

        </ul>
    </nav>
  );
}

export default Nav;
